for(let i=0;i<nareaLen;i++){
	if(newArea[i].name == "全国"){
		newArea[i].city = [];
	}else{
		newArea[i].city = [{
					"id":0,
					"pid":newArea[i].id,
					"level":2,
					"name":"全部"
				}];
		for(let j=0;j<ncityLen;j++){
			if(newCity[j].pid == newArea[i].id){
				newArea[i].city.push(newCity[j]);
			}
		}
		var cityLen = newArea[i].city.length;
		for(let k=0;k<cityLen;k++){
			if(newArea[i].city[k].name == "全部"){
				newArea[i].city[k].area = []
			}else{
				newArea[i].city[k].area = [{
							"id":0,
							"pid":newCity[k].id,
							"level":3,
							"name":"全部"
						}];
				for(let m=0;m<nlocalLen;m++){
					if(newLocal[m].pid == newArea[i].city[k].id){
						newArea[i].city[k].area.push(newLocal[m]);
					}
				}
			}
				
		}
		// 如果是直辖市删除全省字样
		for(let n=0;n<cityLen;n++){
			if(newArea[i].city[n].name.indexOf(newArea[i].name) != -1){
				newArea[i].city.shift();
			}
		}
		
	}
}
